import React from "react";
import style from '../Card/Card.module.css';

export default function Card(props) {
   const{onClose,name,status,species,gender,origin,image} = props 

   return (
      <div className={style.cardContainer}>
        <div className={style.header}>
          <div className={style.buttonContainer}>
            <button onClick={onClose} className={style.closeButton}>
              X
            </button>
          </div>

          <img src={image} alt={name} className={style.cardImage} />
        </div>

        <div className={style.textContainer}>
          <h2 className={style.name}>{name}</h2>
          <p className={style.status}>{status}</p>
          <p className={style.species}>{species}</p>
          <p className={style.gender}>{gender}</p>
          <p className={style.origin}>{origin}</p>
        </div>
      </div>
    );
  }
